import React from 'react'

const AuthorForm = () => {
	return (
		<form className="six columns">
			<h3>Add an Author</h3>
			<div className="twelve columns">
				<label htmlFor="name">Name</label>
				<input type="text" />
			</div>
		</form>
	)
}

export default AuthorForm
